        // Copy to memory, modify in place, and return the memory object.
        P1Types.Balance memory _balance = balance;
        P1BalanceMath.setPosition(_balance, newPosition);
        return _balance;
    }

    // ============ ReentrancyGuard.sol ============

    function nonReentrant1()
