pragma solidity 0.5.16;
pragma experimental ABIEncoderV2;

import { I_MakerOracle } from "../../external/maker/I_MakerOracle.sol";


/**
 * @title Test_MakerOracle
 * @author dYdX
 *
 * MakerOracle for testing
 */
/* solium-disable-next-line camelcase */
contract Test_MakerOracle is
    I_MakerOracle
{
    uint256 public bar = 1;
    uint32 public age = uint32(block.timestamp);
    mapping (address => uint256) public orcl;
    mapping (address => uint256) public bud;
    mapping (uint8 => address) public slot;
    uint256 public _PRICE_ = 0;
    bool public _VALID_ = true;

    // ============ Set Functions ============

    function setBar(
        uint256 newBar
    )
        external
    {
        bar = newBar;
    }

    function setAge(
        uint256 newAge
    )
        external
    {
        age = uint32(newAge);
    }

    function setPrice(
        uint256 newPrice
    )
        external
    {
        _PRICE_ = newPrice;
    }

    function setValidity(
        bool valid
    )
        external
    {
        _VALID_ = valid;
    }

    // ============ Getter Functions ============

    function read()
        external
        view
        returns (bytes32)
    {
        require(
            _VALID_,
            "Median/invalid-price-feed"
        );
        return bytes32(_PRICE_);
    }

    function peek()
        external
        view
        returns (bytes32, bool)
    {
        return (bytes32(_PRICE_), _VALID_);
    }

    // ============ State-Changing Functions ============

    function poke(
        uint256[] calldata,
        uint256[] calldata,
        uint8[] calldata,
        bytes32[] calldata,
        bytes32[] calldata
    )
        external
    { /* solium-disable-line no-empty-blocks */ }

    function lift(
        address[] calldata signers
    )
        external
    {
        for (uint i = 0; i < signers.length; i++) {
            address signer = signers[i];
            uint8 signerId = uint8(uint256(signer) >> 152);
            orcl[signer] = 1;
            slot[signerId] = signer;
        }
    }

    function drop(
        address[] calldata signers
    )
        external
    {
        for (uint i = 0; i < signers.length; i++) {
            address signer = signers[i];
            uint8 signerId = uint8(uint256(signer) >> 152);
            orcl[signer] = 0;
            slot[signerId] = address(0);
        }
    }

    function kiss(
        address reader
    )
        external
    {
        bud[reader] = 1;
    }

    function diss(
        address reader
    )
        external
    {
        bud[reader] = 0;
    }

    function kiss(
        address[] calldata readers
    )
        external
    {
        for (uint256 i = 0; i < readers.length; i++) {
            bud[readers[i]] = 1;
        }
    }

    function diss(
        address[] calldata readers
    )
        external
    {
        for (uint256 i = 0; i < readers.length; i++) {
            bud[readers[i]] = 0;
        }
    }
}

